  \"Klamath Basin National Wildlife Refuges: Tule Lake, Lower Klamath, Clear Lake,
  Upper Klamath, Klamath Forest, and Bear Valley National Wildlife Refuges: Annual
  narrative report: Calendar year 1985\",\n\t\"tracking_summary\": {\n\t\t\"total\":
