  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:25.142176\",\n\t\"name\": \"klamath-basin-national-wildlife-refuges-tule-lake-lower-klamath-clear-lake-upper-klamath-k-f96c0\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Klamath
  Basin NWRs outlines Refuge accomplishments during the 1985 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  management planning, and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, volunteer programs, funding, and safety
  is given. Habitat management is also covered; subjects include wetlands, croplands,
  grasslands, grazing, haying, fire management, and pest control. The wildlife section
  of the report discusses endangered and threatened species, waterfowl, marsh birds
  and waterbirds, shorebirds, raptors, game mammals, scientific collections, animal
  control, marking and bird banding, and disease control. The public uses of the Refuge
  described in this report include outdoor classrooms, interpretive programs, hunting,
  trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, communication systems, and energy conservation. Cooperative programs
  and items of interest are provided at the end. Refuge brochures and field guides
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
